DROP TABLE IF EXISTS Persons;
DROP TABLE IF EXISTS Mahasiswa;
DROP TABLE IF EXISTS Dosen;

CREATE TABLE Mahasiswa (
    mahasiswa_nim varchar(15) PRIMARY KEY,
    nama_mahasiswa varchar(255),
    program_studi varchar(255)
);

CREATE TABLE Dosen (
    dosen_id int PRIMARY KEY,
    nama_dosen varchar(255)
);

CREATE TABLE Persons (
    skripsi_id int PRIMARY KEY,
    judul_skripsi varchar(255),
    minat varchar(50),
    bidang_penelitian varchar(255),
    tanggal_pengajuan date,
    mahasiswa_nim varchar(15),
    dosen_pembimbing_1 int,
    dosen_pembimbing_2 int
);


